// src/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Import your CSS file for styling
import 'font-awesome/css/font-awesome.min.css'; // Import Font Awesome icons
import logo from './logo.png';
const Navbar = () => {
  return (
    <nav className="navbar">
       <div className="navbar-brand">
        <img src={logo} alt="Bus Booking Logo" className="navbar-logo" /> {/* Add logo here */}
        <h1>Bus Booking System</h1>
      </div>
      <ul className="navbar-links">
        <li>
          <Link to="/login">
            <i className="fa fa-sign-in" aria-hidden="true"></i> Login
          </Link>
        </li>
        <li>
          <Link to="/signup">
            <i className="fa fa-user-plus" aria-hidden="true"></i> Signup
          </Link>
        </li>
        <li>
          <Link to="/bus-booking">
            <i className="fa fa-bus" aria-hidden="true"></i> Book a Bus
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
